suite("basic",function(){this.timeout(2e3);var e=document.getElementById("container"),t=new Date("10 March 2015");teardown(function(){e.innerHTML=""}),test("default date",function(t){var a=document.createElement("basic-calendar-week");e.appendChild(a);var n=new Date;flush(function(){assert.equal(n.getDay(),a.date.getDay()),assert.equal(n.getMonth(),a.date.getMonth()),assert.equal(n.getFullYear(),a.date.getFullYear()),t()})}),test("set date attribute",function(t){var a=document.createElement("basic-calendar-week");e.appendChild(a),now=new Date,a.date=now,flush(function(){assert.deepEqual(now,a.date),t()})}),test("dayElementForDate",function(t){var a=document.createElement("basic-calendar-week");e.appendChild(a),flush(function(){var e=a.dayElementForDate(new Date);assert(e),t()})}),test("days",function(a){var n=document.createElement("basic-calendar-week");e.appendChild(n),n.date=t,flush(function(){assert(n.days),assert.equal(n.days.length,7),a()})}),test("firstDate",function(a){var n=document.createElement("basic-calendar-week");e.appendChild(n),n.date=t,flush(function(){var e=new Date("8 March 2015");assert.deepEqual(n.firstDate,e),a()})}),test("lastDate",function(a){var n=document.createElement("basic-calendar-week");e.appendChild(n),n.date=t,flush(function(){var e=new Date("14 March 2015");assert.deepEqual(n.lastDate,e),a()})})});